import React from 'react';

const Card = (props) => {
	const { name, age, gender } = props;
	return (
		<div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
			<h2>{name}</h2>
			<p>Age: {age}</p>
			<p>Gender: {gender}</p>
		</div>
	)
}

export default Card;
